import React from "react";
import { useDispatch, useSelector } from "react-redux";
import { decrement, increment } from "../reducer/reducer";
import { useState } from "react";
import { newUser } from "../reducer/login";
import { Link } from "react-router-dom";

const Main=()=>{

    const [userName,setUserName]=useState()
    const [userAge,setUserAge]=useState()

    const getUserName=(name)=>{
        setUserName(name)
    }

    const getUserAge=(age)=>{
        setUserAge(age)
    }

    const submitUser=(e)=>{
        e.preventDefault()
        dispatch(newUser({username:userName,userage:userAge}))
    }

    const dispatch=useDispatch()
    const count = useSelector((state)=>{
        return state.counter.value
    })
    const username=useSelector((state)=>{
        return state.login.username
    })
    const userage=useSelector((state)=>{
        return state.login.userage
    })
    const usermail=useSelector((state)=>{
        return state.login.usermail
    })

    const incrementCounter=()=>{
        dispatch(increment())
    }

    const reduceCounter=()=>{
        dispatch(decrement())
    }

    return(
        <>
            <div>MAIN</div>

            <div>nombre: {username}</div>
            <div>edad: {userage}</div>
            <div>email: {usermail}</div>

            <div>Change your data</div>
            <Link to='/Changeuserdata'>
                <button>Change data</button>
            </Link>
        </>
    )
}

export default Main
